import './App.css';
import Navigation from './components/Navigation';
import { BrowseRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
      <Navigation />
      <Route path='/' exact />
      </Router>
      </>
  );
}

export default App;
